import React, {Component} from "react";

export default class DetailTable extends Component {

    render() {

        return(
            <div id="detail">
                <table>
                    <tbody>
                        <tr className={(this.props.item.variableSymbol === 0 ? "hideEmptyRow" : "")}>
                            <td id="column1"></td>
                            <td id="column2">
                                <b>Variabiln√≠ symbol:</b>
                            </td>

                            <td id="column3">
                                {this.props.item.variableSymbol}
                            </td>
                        </tr>

                        
                    </tbody>
                </table>
            </div>
        )
    }

}
